import React from "react";
import Brian from "./brian.jpg";
import Peter from "./peter.jpeg";
import Bruce from "./bruce.jpeg";
import Chris from "./chris.jpg"



function Column(props) {
  return (
  <div className="col-sm" {...props} >
    <img src = {Brian} alt = "Brian"/>
    <img src = {Peter} alt = "Peter"/>
    <img src = {Bruce} alt = "Bruce"/>
    <img src = {Chris} alt = "Chris"/>
  </div>
  )
}

export default Column;
